export async function seed(knex: Knex): Promise<void> {
    // Deletes ALL existing entries
    await knex('tags').del();
    await knex("stocks").del();

    let seedArray = []
    for (let symbol in symbolList) {
        let object = { 'symbol': symbol, 'name': symbolList[symbol] }
        seedArray.push(object)
    }    
    
    // Inserts seed entries
    await knex("stocks").insert(seedArray);
};